import { Component, OnInit } from '@angular/core';
import { Router, ActivatedRoute } from '@angular/router';

@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

  constructor(private _router: Router,
    private _route: ActivatedRoute) { }

  orders() {
    if (sessionStorage.getItem("email") === null) {
      this._router.navigate(['/login'])
    } else {
      this._router.navigate(['/Table'])
    }
  }
}
<head>
    <link rel="preconnect" href="https://fonts.googleapis.com">
    <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
    <link href="https://fonts.googleapis.com/css2?family=Bebas+Neue&display=swap" rel="stylesheet">
</head>

<body>
    <div id="full-area" class="container-fluid no-padding">
        <div id="row-index" class="row no-padding">
            <div id="left-side" class="col-md-6 no-padding">
                <h1 id="headertext">HOME SWEET RENTED HOME!</h1>
                <a id="listing-button" asp-area="" asp-controller="House" asp-action="Grid">
                    <button type="button" class="button" [routerLinkActive]="['link-active']"  [routerLink]="['/houses']"><span>Houses</span></button>
                </a>
                <a id="order-button" asp-controller="Order" asp-action="Table" asp-route-email="@UserManager.GetUserName(User)">
                    <button type="button" class="button" [routerLinkActive]="['link-active']" (click)="orders()"><span>Orders</span></button>
                </a>
            </div>
            <div id="right-side" class="col-md-6 no-padding">
                <div class="dark-background">
                    <img src="./../assets/images/lux-house.jpg" id="image" alt="Villa" />
                </div>
            </div>
        </div>
    </div>
</body>
